import React from 'react';

export default function Footer() {
  const wrap = {
    width: '100%',
    background: '#f3f3f0',
    borderTop: '1px solid #e3e3de',
    marginTop: 24
  };
  const inner = {
    maxWidth: 1200,
    margin: '0 auto',
    padding: '12px 16px',
    color: '#233042',
    boxSizing: 'border-box',
    fontSize: 13
  };
  const links = {
    display: 'flex',
    flexWrap: 'wrap',
    gap: 12,
    alignItems: 'center'
  };
  const aStyle = { color: '#233042', textDecoration: 'none' };
  const sep = { color: '#8a8f96' };

  return (
    <footer style={wrap} aria-label="Pie de página">
      <div style={inner}>
        <nav style={links} aria-label="Enlaces del sitio">
          <a href="/" style={aStyle}>Inicio</a>
          <span style={sep}>·</span>
          <a href="/?tipo=Pistola" style={aStyle}>Pistolas</a>
          <span style={sep}>·</span>
          <a href="/?tipo=Fusil" style={aStyle}>Fusiles</a>
          <span style={sep}>·</span>
          <a href="/?tipo=Escopeta" style={aStyle}>Escopetas</a>
          <span style={sep}>·</span>
          <a href="/?tipo=Revolver" style={aStyle}>Revólveres</a>
          <span style={sep}>·</span>
          <a href="/?tipo=Carabina" style={aStyle}>Carabinas</a>
          <span style={sep}>·</span>
          <a href="/publicar" style={aStyle}>Publicar</a>
          <span style={sep}>·</span>
          <a href="/contacto" style={aStyle}>Contacto</a>
          <span style={sep}>·</span>
          <a href="/aviso-legal" style={aStyle}>Aviso legal</a>
        </nav>
        <div style={{ marginTop: 6, color: '#6b7280' }}>
          © {new Date().getFullYear()} ventadearmas.ar
        </div>
      </div>
    </footer>
  );
}
